import React from 'react';
//import logo from './logo.svg';
import './App.css';
import Titulofinal from './Componentes_primarios/Titulo.js';
import Cajafinal from './Componentes_primarios/Cajatexto.js';
import Cajapassword from './Componentes_primarios/Cajapassword.js'
/*
function CajaTexto(props){
  return(
    <div><input type="text" name="nombredelacaja" placeholder={props.PlaceHolderUsuario}/></div>  
  )
}
*/

class Page extends React.Component{
  render(){
    return(
      <div>
        <Titulofinal></Titulofinal>
      </div>
    )
  }
}

class Ingreso extends React.Component{
  render(){
    return(
      <div className="App-formulario">
        <div className="App-ingreso">
          <div><Cajafinal></Cajafinal></div>
          <div><Cajapassword></Cajapassword></div>
          <div><input type="password" name="txtPassword" placeholder="**********"/></div>
          <div><button type="button">Click Me!</button></div>
          <p><a href="www.google.com">¿Has olvidado el id de ingreso o contraseña?</a></p>
          <p><a href="www.google.com">Nuevo Usuario</a></p>
        </div>
      </div>
    )
  }
}
//<FormLogin TituloPrincipal="KeyManage" PlaceHolderUsuario="Usuario"></FormLogin>
class App extends React.Component{
  render(){
    return(
      <div className="App">
      <header className="App-header">
        <div className="">
          <Page></Page>
        </div>
        <div className="">
          <Ingreso></Ingreso>
        </div>
      </header>
    </div>
    )
  }
}

